import Footer from './Components/Footer';
// import SkillsBox from "./Components/SkillsBox";
import Skills from "./Components/Skills";

function App() {
  return (
    <div className="App">

      <TemporaryDrawer />
      <Home />
      <div>Phrase d'intro</div>
      <div>My Skills / Soft and More et bouton pour voir plus</div>
      <div>My background</div>
      <div>Some project I have worked on</div>
      <div>Contact</div>
      <Skills
       nom="Travis Kalanick"
       label1="gogo"
       progress1="héhé"
       label2="gogo"
       progress2="héhé"
       label3="gogo"
       progress3="héhé"/>
      <Background />
      <Contact />
      <Footer />

    </div>
  );
}

export default App;
